import mockApi from './mockApi';

export const dietService = {
  async list() {
    const { data } = await mockApi.getMeals();
    return data;
  },

  async create(meal) {
    const { data } = await mockApi.addMeal(meal);
    return data;
  },

  async getById(id) {
    // Mock get by ID
    return { data: { id, name: 'Mock Meal', calories: 0 } };
  },

  async update(id, meal) {
    const { data } = await mockApi.addMeal({ ...meal, id });
    return data;
  },

  async remove(id) {
    return { data: { message: 'Meal deleted successfully' } };
  }
};

export default dietService;
